import React from "react";
import styled from "styled-components";
import quizzes from "../data.json";
import img from "./assets/images/icon-html.svg";
import QuestionsComp from "./QuestionsComp";

const Outerwrapper = styled.div`
  height: 80%;
  width: 90%;
  margin: auto;
  display: flex;
  border: var(--green) solid 1px;
`;

const Equalinnerdiv = styled.div`
  display: flex;
  flex-direction: column;
  flex: 1;
  border: var(--red) solid 1px;
  text-align: left;
  padding: 30px;
`;

const Unequalinnerdiv = styled.div`
  display: flex;
  flex-direction: column;
  flex: 0.5;
  visibility: none;
`;

const Sectiongrid = styled.div`
  flex: 1;
  margin: 20px;
  width: 564px;
  height: 86px;
  //border: var(--red) solid 1px;
  border-radius: 5px;
  background-color: var(--verylightblue);
`;
const headerText = styled.h1``;

interface Tquestion {
  title: string;
  icon: string;
  questions: Array<Tquestions>;
}

type Tquestions = {
  question: string;
  options: string[];
  answer: string;
};

interface props {
  data: Tquestion;
}

const LandingpageComp: React.FC = () => {
  let data: Array<Tquestion>[];
  data = Object.values(quizzes);

  return (
    <Outerwrapper>
      <Equalinnerdiv>
        <Equalinnerdiv>
          <h1>Welcome to the</h1>
          <p>Frontend Quiz</p>
        </Equalinnerdiv>
        <Unequalinnerdiv></Unequalinnerdiv>
      </Equalinnerdiv>
      <Equalinnerdiv>
        <>
          {data[0].map((i, idx) => {
            console.log(idx, i);
            return (
              <QuestionsComp
                key={idx}
                title={i.title}
                icon={i.icon}
                questions={i.questions}
              />
            );
          })}
        </>
      </Equalinnerdiv>
    </Outerwrapper>
  );
};

export default LandingpageComp;
